[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "mondo"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT (COUNT(DISTINCT ?disease) as ?count)
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           nando:hasNotificationNumber ?notif_num ;
           skos:closeMatch ?mondo .
  FILTER(STRSTARTS(STR(?mondo), "http://purl.obolibrary.org/obo/MONDO_"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT (COUNT(DISTINCT ?disease) as ?total_designated)
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           nando:hasNotificationNumber ?notif_num .
}"}}]

[{"name": "mcp__togomcp__search_mesh_entity", "input": {"query": "Erdheim-Chester disease", "limit": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?descriptor ?descriptorUI ?label
WHERE {
  ?descriptor a meshv:Descriptor ;
              rdfs:label ?label ;
              meshv:identifier ?descriptorUI .
  FILTER(CONTAINS(LCASE(?label), "erdheim-chester"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mesh", "sparql_query": "PREFIX meshv: <http://id.nlm.nih.gov/mesh/vocab#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?label ?id
WHERE {
  <http://id.nlm.nih.gov/mesh/T459455> rdfs:label ?label .
  OPTIONAL { <http://id.nlm.nih.gov/mesh/T459455> meshv:identifier ?id }
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX bacdive: <http://bacdive.dsmz.de/rdfs/>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
WHERE {
  ?strain rdf:type bacdive:Strain .
  ?strain bacdive:hasTemperatureRange ?tempRange .
  ?tempRange bacdive:temperatureMaximum ?maxTemp .
  FILTER(?maxTemp > 70)
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain .
  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeEnd ?tempEnd .
  FILTER(?tempEnd > 70)
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?label ?genus ?species ?tempStart ?tempEnd
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?label ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeStart ?tempStart ;
        schema:hasTemperatureRangeEnd ?tempEnd .
  FILTER(?tempEnd > 70)
}
ORDER BY DESC(?tempEnd)
LIMIT 20
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pubchem"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT ?compound ?weight
WHERE {
  ?compound a vocab:Compound ;
            obo:RO_0000087 vocab:FDAApprovedDrugs ;
            sio:SIO_000008 ?weightDesc .
  ?weightDesc a sio:CHEMINF_000334 ;
              sio:SIO_000300 ?weight .
  FILTER(?weight >= 150 && ?weight <= 200)
}
ORDER BY ?weight
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pubchem", "sparql_query": "PREFIX vocab: <http://rdf.ncbi.nlm.nih.gov/pubchem/vocabulary#>
